{
  "openapi": "3.0.3",
  "components": {
    "schemas": {
      "sandbox": {
        "description": "This APIs allows to create a temporary namespace to experiment with\nMicrosegmentation.\nThis API is not authenticated, and contains small quotas. After one hour,\neverything will be deleted.",
        "properties": {
          "URL": {
            "description": "Contains a link to directly connect the UI to your API sandbox.",
            "readOnly": true,
            "type": "string"
          },
          "credentials": {
            "$ref": "./credential#/components/schemas/credential"
          },
          "lifetime": {
            "description": "Contains the lifetime of the sandbox namespace.",
            "readOnly": true,
            "type": "string"
          },
          "namespace": {
            "description": "Contains the name of the sandbox namespace that has been created.",
            "readOnly": true,
            "type": "string"
          }
        },
        "type": "object"
      }
    }
  },
  "info": {
    "contact": {
      "email": "dev@aporeto.com",
      "name": "Aporeto Inc.",
      "url": "go.aporeto.io/api"
    },
    "license": {
      "name": "TODO"
    },
    "termsOfService": "https://localhost/TODO",
    "title": "sandbox",
    "version": "1.0"
  },
  "paths": {
    "/sandboxes": {
      "post": {
        "description": "Creates a temporary api sandbox.",
        "operationId": "create-a-new-sandbox",
        "requestBody": {
          "content": {
            "application/json": {
              "schema": {
                "$ref": "#/components/schemas/sandbox"
              }
            }
          }
        },
        "responses": {
          "200": {
            "content": {
              "application/json": {
                "schema": {
                  "$ref": "#/components/schemas/sandbox"
                }
              }
            },
            "description": "n/a"
          }
        },
        "tags": [
          "ext/documentation",
          "service"
        ]
      }
    }
  },
  "tags": [
    {
      "description": "This tag is for group 'ext/documentation'",
      "name": "ext/documentation"
    },
    {
      "description": "This tag is for package 'service'",
      "name": "service"
    }
  ]
}
